def findName(mail):
    name = ''
    for c in mail:
        if c not in string.digits:
            name = name + c
        else:
            break
    return name

def makeUsername(name):
    name = name + random.randrange(1, 99)
    if random.randrange(10)>5:
        for j in random.randrange(1, 4):
            name = name + random.choice([".", "_", "-"])
    return name


